function electron_escape_spectrum_x_ray_02_L()

    % X-ray photoemission electron
    % target is homogeneous, semiinfinite
    % quantum effects in the boundary condition


    %% preparation for the computation
    clear all
    close all
    clc
    drawnow;
    format long;


    %% variables dimensions  (default)
    %%% [length]=R0; [energy]=E0; [angle]=rad; [unsize]=unsize;


    %% input data (default)
    atom_name_input = 'Si';
    xq_nm_input = Inf;
    E_cut_eV_input = 0;
    quantum_effect_mode_input = 'On';
    data_type_input = 'A';
    animation_mode_input = 'Yes';


    %% dialogue data entry
    prompt = {'Emitter, (chemical symbol of atom)',...
              'Xq, nm (thickness of emission layer)',...
              'Ecut, eV (cut value of energy)',...
              'Quantum Effect (On; Off)',...
              'Type of data (A - analytical; T - table; P - approximation)',...
              'Animation (Yes; No)',...
              };

    def_input = {atom_name_input,...
                 num2str(xq_nm_input),...
                 num2str(E_cut_eV_input),...
                 quantum_effect_mode_input,...
                 data_type_input,...
                 num2str(animation_mode_input), ...
                 };

    dlgTitle='Input parameters'; lineNo=1;
    answer = inputdlg(prompt,dlgTitle,lineNo,def_input);
    if isempty(answer) %%% chek cancel
        return;
    end
    atom_name_input = answer{1};
    xq_nm_input = abs(str2double(answer{2}));
    E_cut_eV_input = abs(str2double(answer{3}));
    quantum_effect_mode_input = upper(answer{4});
    data_type_input = upper(answer{5});
    animation_mode_input = upper(answer{6});

    disp(' ');
    disp('Input parameters:');
    disp('Atom  xq(nm)  Ecut(eV)  Type of Data');
    str_input_parameters = [atom_name_input '    ' num2str(xq_nm_input) '     ' num2str(E_cut_eV_input) '        ' data_type_input];
    disp(str_input_parameters);


    %% drawing options
    global fig_no figure_pause_time
    fig_no = 0;
    figure_pause_time = 1; %1;
    animation_pause_time = 0.02;
    animation_enabled = isequal(animation_mode_input,'YES');


    %%  groups of electrons parameters
    global n_group prob_group t0_group
    atom_name = atom_name_input;
    emission_parameters = emission_data(atom_name);
    description_group = emission_parameters.description_group;
    E0_keV_group = emission_parameters.E0_keV_group;
    prob_group = emission_parameters.prob_group;
    n_group = emission_parameters.n_group;
    E0_keV = E0_keV_group(1);
    t0_group = 1 - E0_keV_group/E0_keV;

    disp(' ');
    disp('Groups of emission electrons');
    disp(description_group);


    %% parameters of matter
    global t_point deds_point l_tr_point quantum_effect_enabled U0
    E0_eV = E0_keV * 1e+3;
    data_type = data_type_input;
    E_cut_eV = E_cut_eV_input;
    compute_parameters = input_data(atom_name, E0_eV, data_type);
    l_tr_point = compute_parameters.l_tr_point;
    deds_point = compute_parameters.deds_point;
    t_point = compute_parameters.t_point;
    R0_nm = compute_parameters.R0_nm;

    if isequal(quantum_effect_mode_input,'ON')
        quantum_effect_enabled = true;
    else
        quantum_effect_enabled = false;
    end

    U0_eV = compute_parameters.U0_eV;
    U0 = U0_eV / E0_eV; % global
    t_cut = 1 - E_cut_eV/E0_eV;
    t_quantum_limit = 1 - U0;
    t_quantum_limit = t_quantum_limit - 1e-10; %%% correction values for numerical computations

    %% grid over x
    global xq
    xq = xq_nm_input/R0_nm;
    if xq > 1
        xq = 1;
    end
    x_min = 0;
    x_max = xq + 1;
    nx = 250; %250;
    x = linspace(x_min, x_max, nx);


    %% grid over t
    global dt
    t_min = t_point(1);
    t_end_point = min([t_quantum_limit t_point(end)]);
    if t_cut < t_end_point
        t_max = t_cut;
    else
        t_max = t_end_point;
    end
    nt = round( nx * t_max/t_end_point );
    t = linspace(t_min, t_max, nt);
    dt = t(2) - t(1);


    %% refinement grid over t
    E_dense_point_eV = 50;
    t_by_dense_point = 1 - E_dense_point_eV/E0_eV;
    if t_by_dense_point < t_max
        mesh_density = nt/(t_max - t_min);
        k_density = 20;
        high_mesh_density = k_density*mesh_density;
        nt_add = round( (t_max - t_by_dense_point)*high_mesh_density );
        t_add = linspace(t_by_dense_point, t_max, nt_add);

        idx_t_by_dense_point = 0;
        for i = nt:-1:1
            if t_by_dense_point <= t(i)
                idx_t_by_dense_point = i;
            end
        end

        t(idx_t_by_dense_point:end) = [];
        t = [t t_add];
        nt = length(t);
    end


    %% drawing coefficient in the boundary condition
    fig_no = fig_no + 1;
    figure(fig_no), plot(t,b_coeff(t)), xlabel('t'), ylabel('boundary coefficient'),...
        axis([0 1 0 1.04*max(b_coeff(t))]);
    set(figure(fig_no), 'NumberTitle', 'off', 'Name', 'Boundary coefficient'), drawnow;
    pause(figure_pause_time);


    %% решение уравнения диффузии
    ode_options = odeset('RelTol',5e-5,'MaxStep',dt);
    sol = pdepe(0, @pdefunction, @icfunction, @bcfunction, x, t, ode_options);
    u = sol(:,:,1);


    %% прорисовка поверхности Ф0(x,t)
    fig_no = fig_no + 1;
    umax = max(max(u));
    colormap('cool');
    figure(fig_no), surf(x,t,u), xlabel('x'), ylabel('t'), zlabel('\Phi_0(x,t)'),...
    axis([x_min x_max t_min t_max 0 umax]);
    set(figure(fig_no), 'NumberTitle', 'off', 'Name', 'Surface \Phi_0(x,t)'), drawnow;
    pause(figure_pause_time);


    %% drawing profiles \Phi_0(x,t=const)
    fig_no = fig_no + 1;
    figure(fig_no);
    set(figure(fig_no), 'NumberTitle', 'off', 'Name', '\Phi_0(x,t=0)');
    for i=1:nt
        if (animation_enabled)||(i==nt)
            figure(fig_no), plot(x,u(i,:)), axis([x_min x_max 0 umax]), drawnow;
            pause(animation_pause_time);
        end
    end
    figure(fig_no), xlabel('x'), ylabel('\Phi_0(x,t=0)'), axis([x_min x_max 0 umax]);
    pause(figure_pause_time);
    grid on;
    drawnow;
    pause(figure_pause_time);


    %% error control
    N_absorbed = zeros(1,nt);
    N_escaped = zeros(1,nt);
    N_summ = zeros(1,nt);
    N_summ_true = zeros(1,nt);
    dbde = (1/2) * quantum_coeff(t) .* u(:,  1)' ./deds(t);

    for j=1:nt
        for i=1:nx-1
            N_absorbed(j) = N_absorbed(j) + 0.5*(u(j,i+1) + u(j,i))*(x(i+1)-x(i));
        end
        if j < nt
            N_escaped(j+1) = N_escaped(j) + 0.5*(dbde(j+1) + dbde(j))*(t(j+1)-t(j));
        end
        N_summ(j) = N_absorbed(j) + N_escaped(j);

        k_group = t0_group <= t(j);
        N_summ_true(j) = xq * sum( prob_group.*k_group );
    end


    %% the resulting coefficients
    num_digits = 6;
    escaped_coeff = cut_digits(N_escaped(end), num_digits);
    absorbed_coeff = cut_digits(N_absorbed(end), num_digits);
    summ_coeff = cut_digits(N_summ(end), num_digits);
    summ_true_coeff = cut_digits(N_summ_true(end), num_digits);
    error_coeff_percent = cut_digits( 100*abs((summ_coeff - summ_true_coeff)/summ_true_coeff) , 2);

    disp(' ');
    disp('Output parameters:');
    disp('escaped  absorbed  summ    error(%)  (summ_true)');
    str_output_parameters = [num2str(escaped_coeff) '   ' num2str(absorbed_coeff) '    ' num2str(summ_coeff) '   ' num2str(error_coeff_percent) '       (' num2str(summ_true_coeff) ')'];
    disp(str_output_parameters);

    if error_coeff_percent > 5
        uiwait(msgbox('Warning! Error in calculate is too large','Program message'));
    end


    %% прорисовка коэффициентов
    max_N = max( [max(N_summ) max(N_summ_true)] );
    fig_no = fig_no + 1;
    figure(fig_no), hold on,...
        plot(t, N_summ_true, 'k--', 'LineWidth', 2),...
        plot(t, N_absorbed, 'b'),...
        plot(t, N_escaped, 'r'),...
        plot(t, N_summ, 'g', 'LineWidth', 2),...
        axis([0 1 0 1.04*max_N]), xlabel('t'), ylabel('absorbed, escaped, summ'), grid on;
    legend_matrix = {'true_summ', 'absorbed', 'escaped', 'summ of absorbed and escaped'};
    legend_handle = legend('show');
    set(legend_handle,...
        'Box', 'on',...
        'String', legend_matrix,...
        'Location', 'NorthWest');
    set(figure(fig_no), 'NumberTitle', 'off', 'Name', 'Control Calculating');
    drawnow;
    pause(figure_pause_time);


    %% drawing spectrum
    e = 1 - t;
    e_quantum_limit = 1 - t_quantum_limit;
    e = e - e_quantum_limit; %%% reduction of energy consist of particles on the potential barrier height
    fig_no = fig_no + 1;
    figure(fig_no),...
        plot(e*E0_eV, dbde/E0_eV), axis([0 E0_eV 0 1.04*max(dbde/E0_eV)]), xlabel('E, eV'), ylabel('db/dE, 1/eV');
    set(figure(fig_no), 'NumberTitle', 'off', 'Name', 'Spectrum'), drawnow;
    pause(figure_pause_time);


% --------------------------------------------------------------
function [c,f,s] = pdefunction(x,t,u,DuDx)
    c = 1;
    f = a_coeff(t)*DuDx;
    s = source_function(x,t);
% --------------------------------------------------------------
function u0 = icfunction(x)
    global prob_group
    u0 = prob_group(1)*eta(x);
% --------------------------------------------------------------
function [pl,ql,pr,qr] = bcfunction(xl,ul,xr,ur,t)
    pl = ul*b_coeff(t);
    ql = -1/a_coeff(t);
    pr = ur;
    qr = 0;
% --------------------------------------------------------------
function a_coeff_out = a_coeff(t)
    a_coeff_out = (1/3)*l_tr(t)/deds(t);
% --------------------------------------------------------------
function b_coeff_out = b_coeff(t)
    b_coeff_out = quantum_coeff(t) .* 3./( 2*l_tr(t) );
% --------------------------------------------------------------
function quantum_coeff_out = quantum_coeff(t)
    global U0 quantum_effect_enabled

    if quantum_effect_enabled
        e = 1 - t;
        c = U0./e;

        I1 = (1/2)*(c+1./c)-1+...
            (1/4)*(1-2./c).*sqrt(1-c)-...
            (c/8).*log(c./(2-c+2*sqrt(1-c)));

        I2 = (2/3)*(1-c.^(3/2))+...
            (2/3)*(1-c).^(3/2)-...
            (2./(5*c)).*(1-c.^(5/2))+...
            (2./(5*c)).*(1-c).^(5/2);

        quantum_coeff_out = I1./(3*I2/2-1);
    else
        quantum_coeff_out = 1;
        return;
    end
% --------------------------------------------------------------
function deds_out = deds(t)
    global t_point deds_point
    %deds_out = interp1(t_point, deds_point, t, 'cubic');
    deds_out = interp1q(t_point', deds_point', t');
    deds_out = deds_out';
% --------------------------------------------------------------
function l_tr_out = l_tr(t)
    global t_point l_tr_point
    %l_tr_out = interp1(t_point, l_tr_point, t, 'cubic');
    l_tr_out = interp1q(t_point', l_tr_point', t');
    l_tr_out = l_tr_out';
% --------------------------------------------------------------
function source_function_out = source_function(x,t)
    global n_group prob_group t0_group

    summ = 0;
    for i = 2:n_group
        summ = summ + prob_group(i)*delta(t,t0_group(i));
    end
    source_function_out = summ * eta(x);
% --------------------------------------------------------------
function delta_out = delta(t,tp)
    global dt
    if (tp-dt/2 <= t) && (t < tp+dt/2)
        delta_out = 1/dt;
    else
        delta_out = 0;
    end

% global dt
% sigma = 1*dt;
% delta_out = 1/(sigma*sqrt(2*pi)) * exp( -(t-tp).^2/(2*sigma^2) );
% --------------------------------------------------------------
function eta_out = eta(x)
    global xq
    if (0<=x)&&(x<xq)
        eta_out = 1;
    else
        eta_out = 0;
    end
% --------------------------------------------------------------
function emission_parameters_out = emission_data(atom_name)
    fields = {'name', 'description_group', 'E0_keV_group', 'prob_group'};
    %%% data entry rule: in the table of electrons must be specified
    %%% in descending order from starting energy
    emission_data_cell = {...
        'Ge', 'eM eL eLMM', [7.9 6.83 1.16], [0.12 0.88 0.86];
        'Si', 'eL eK eKLL', [7.9 6.2 1.6], [0.08 0.92 0.88] };
    emission_data_struct = cell2struct(emission_data_cell, fields, 2);

    for i = 1:length(emission_data_struct)
        if isequal(emission_data_struct(i).name, atom_name)
            description_group = emission_data_struct(i).description_group;
            E0_keV_group = emission_data_struct(i).E0_keV_group;
            prob_group = emission_data_struct(i).prob_group;
        end
    end

    emission_parameters_out.description_group = description_group;
    emission_parameters_out.E0_keV_group = E0_keV_group;
    emission_parameters_out.prob_group = prob_group;
    emission_parameters_out.n_group = length(E0_keV_group);
% --------------------------------------------------------------
function compute_parameters_out = input_data(atom_name, E0_eV, data_type)
    global fig_no figure_pause_time
    % e\phi_s=4.9 eV [8] A. Papageorgeopoulos, M. Kamaratos. J. Phys.: Cond. Matter
    % 14, 22, 5255 (2002). in Физика твердого тела, 2005, том 47, вып. 9
    % E_{3s^2) = 13.57 eV Gurtov
    % U0_eV = 4.9+13.57 = 18.47

    fields = {'name', 'Z', 'Av_g_mol', 'density_g_cm3', 'U0_eV'};
    atom_data_cell = {...
     'H', 1, 1.008, 0, 0;
     'He', 2, 4.003, 0, 0;
     'Li', 3, 6.940, 0, 0;
     'Be', 4, 9.013, 0, 0;
     'B', 5, 10.82, 0, 0;
     'C', 6, 12.011, 0, 0;
