     'O', 8, 16.0, 0, 0;
     'F', 9, 19.0, 0, 0;
     'Ne', 10, 20.183, 0, 0;
     'Na', 11, 22.991, 0, 0;
     'Mg', 12, 24.32, 0, 0;
     'Al', 13, 26.98, 2.700, 0;
     'Si', 14, 28.09, 2.321, 18.47; 
     'P ', 15, 30.975, 0, 0;
     'S ', 16, 32.066, 0, 0;
     'Cl', 17, 35.457, 0, 0;
     'Ar', 18, 39.944, 0, 0;
     'K ', 19, 39.100, 0, 0;
     'Ca', 20, 40.08, 0, 0;
     'Sc', 21, 44.96, 0, 0;
     'Ti', 22, 47.90, 0, 0;
     'V ', 23, 50.95, 0, 0;
     'Cr', 24, 52.01, 0, 0;
     'Mn', 25, 54.94, 0, 0;
     'Fe', 26, 55.85, 0, 0;
     'Co', 27, 58.94, 0, 0;
     'Ni', 28, 58.71, 0, 0;
     'Cu', 29, 63.54, 0, 0;
     'Zn', 30, 65.38, 0, 0;
     'Ga', 31, 69.72, 0, 0;
     'Ge', 32, 72.60, 5.350, 12.5;
     'As', 33, 74.91, 0, 0;
     'Se', 34, 78.96, 0, 0;
     'Br', 35, 79.916, 0, 0;
     'Kr', 36, 83.80, 0, 0;
     'Rb', 37, 85.48, 0, 0;
     'Sr', 38, 87.63, 0, 0;
     'Y ', 39, 88.92, 0, 0;
     'Zr', 40, 91.22, 0, 0;
     'Nb', 41, 92.91, 0, 0;
     'Mo', 42, 95.95, 0, 0;
     'Tc', 43, 97.0, 0, 0;
     'Ru', 44, 101.1, 0, 0;
     'Rh', 45, 102.91, 0, 0;
     'Pd', 46, 106.4, 0, 0;
     'Ag', 47, 107.88, 0, 0;
     'Cd', 48, 112.41, 0, 0;
     'In', 49, 114.82, 0, 0;
     'Sn', 50, 118.70, 7.300, 0;
     'Sb', 51, 121.76, 0, 0;
     'Te', 52, 127.61, 0, 0;
     'J ', 53, 126.91, 0, 0;
     'Xe', 54, 131.30, 0, 0;
     'Cs', 55, 132.91, 0, 0;
     'Ba', 56, 137.36, 0, 0;
     'La', 57, 138.92, 0, 0;
     'Ce', 58, 140.13, 0, 0;
     'Pr', 59, 140.92, 0, 0;
     'Nd', 60, 144.27, 0, 0;
     'Pm', 61, 145.0, 0, 0;
     'Sm', 62, 150.35, 0, 0;
     'Eu', 63, 152.0, 0, 0;
     'Gd', 64, 157.26, 0, 0;
     'Tb', 65, 158.93, 0, 0;
     'Dy', 66, 162.51, 0, 0;
     'Ho', 67, 164.94, 0, 0;
     'Er', 68, 167.27, 0, 0;
     'Tm', 69, 168.934, 0, 0;
     'Yb', 70, 173.04, 0, 0;
     'Lu', 71, 174.99, 0, 0;
     'Hf', 72, 178.49, 0, 0;
     'Ta', 73, 180.95, 0, 0;
     'W ', 74, 183.86, 0, 0;
     'Re', 75, 186.22, 0, 0;
     'Os', 76, 190.2, 0, 0;
     'Ir', 77, 192.2, 0, 0;
     'Pt', 78, 195.09, 0, 0;
     'Au', 79, 197.0, 19.3, 0;
     'Hg', 80, 200.59, 0, 0;
     'Tl', 81, 204.39, 0, 0;
     'Pb', 82, 207.21, 11.344, 0;
     'Bi', 83, 209.00, 0, 0;
     'Po', 84, 209.0, 0, 0;
     'At', 85, 210.0, 0, 0;
     'Rn', 86, 222.0, 0, 0;
     'Fr', 87, 223.0, 0, 0;
     'Ra', 88, 226.0, 0, 0;
     'Ac', 89, 227.0, 0, 0;
     'Th', 90, 232.05, 0, 0;
     'Pa', 91, 231.0, 0, 0;
     'U ', 92, 238.07, 0, 0;
     'Np', 93, 237.0, 0, 0;
     'Pu', 94, 244.0, 0, 0;
     'Am', 95, 243.0, 0, 0;
     'Cm', 96, 247.0, 0, 0;
     'Bk', 97, 247.0, 0, 0;
     'Cf', 98, 249.0, 0, 0;
     'Es', 99, 254.0, 0, 0;
     'Fm', 100, 257.0, 0, 0;
     'Md', 101, 259.0, 0, 0;
     'No', 102, 262.0, 0, 0;
     'Lr', 103, 265.0, 0, 0};

    atom_data_struct = cell2struct(atom_data_cell, fields, 2);
    for i = 1:length(atom_data_struct)
        if isequal(atom_data_struct(i).name, atom_name)
            Z = atom_data_struct(i).Z;
            Av = atom_data_struct(i).Av_g_mol;
            density = atom_data_struct(i).density_g_cm3;
            U0_eV = atom_data_struct(i).U0_eV;

            disp(' ');
            disp(['U0_eV = ' num2str(U0_eV)]);

            break;
        end
    end

    %qe = 1.6021892e-19; % Coulomb
    N_av = 6.022045e+23; % 1/g_mol
    ALFA = 1/137;

    re = 2.8179380e-13; % cm Classical radius of electron
    mc2_eV = 0.51100341e6; % Electron mass in eV

    if isequal(data_type,'A') % calculate by analytical data
    % For nonrelativistic electrons the energy loss per unit path can be calculated 
    % using the formula proposed by Vavilov VS \ cite {Vavilov}
    % \begin{equation}
    %   - \frac{dE}{ds} = \frac{4 \pi e^4}{m_e v^2} nZ
    %      \ln \left(\frac{ m_e v^2}{2 I}\sqrt{\frac{e}{2}}\right),
    %      \label{eq:Vavilov} 
    % \end{equation}
    % where $ e $ in the radical expression - the base of natural logarithms,
    % $\sqrt{\dfrac{e}{2}}=1.166$.
    % To calculate the average excitation potential of the atom is often used
    % empirical expression \ cite {}
    % \begin{equation}
    % I(Z)=\left\lbrace {\begin{array}{*{20}{c}}
    % {13.6Z,\,\,\,\,\,\,Z < 10;} \\
    % {(9.76 + 58.8{Z^{ - 1.19}})Z,\,\,\,Z \geqslant 10.} \\
    % \end{array} } \right.  
    % \label{eq:IP}
    % \end{equation}
        if  Z < 10 
            J_eV = 13.6*Z;
        else
            J_eV = (9.76 + 58.8*Z^(-1.19))*Z;
        end
        J_mc2 = J_eV/ mc2_eV;  
        Nc = density*N_av/Av; 
        factor1 = mc2_eV * 4*pi*re^2*Nc*Z;
        factor2 = 1.166/J_mc2;

        E_stop_log_zero = J_eV / 1.166;
        E_stop = E_stop_log_zero*1.01; % for Si J_ev = 172 eV, E_stop = 149 eV



        nE = 500; %!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
        E_point = linspace(E0_eV, E_stop, nE); %  eV
        R_point = zeros(size(E_point));

        for i = nE:-1:2
            dE = E_point(i-1) - E_point(i);
            R_point(i-1) = R_point(i) + 0.5 * ( dSdE(E_point(i), mc2_eV, factor1, factor2) + dSdE(E_point(i-1), mc2_eV, factor1, factor2) ) * dE;
        end
        R0_cm = max(R_point); % cm
        R0_nm = R0_cm * 1e+7;  % nm 
        r_point = R_point/R0_cm; % path length in R0_cm units


        dEdS_point = 1./dSdE(E_point, mc2_eV, factor1, factor2); % eV/cm

        deds_point = dEdS_point*(R0_cm/E0_eV); 
        e_point = E_point/E0_eV;


        L = 1;

        C_point = zeros(1,L+1);
        S_l_point = zeros(L+1, nE);

        for j = 1:nE
            E = E0_eV*e_point(j);
            T = E/mc2_eV;

            beta2 = T*(T+2)/(T+1)^2;
            p2 = T*(T+2);
            eta = (1/4)*(ALFA*Z^(1/3)/0.885)^2/p2*(1.13+3.76*(ALFA*Z)^2/beta2);

            C_point(lf(0)) = 0;
            C_point(lf(1)) = log(1+1/eta)-1/(1+eta);
            for i = 1:L-1
                C_point(lf(i+1)) = (2 + 1/i)*(1 + 2*eta)*C_point(lf(i)) - (1 + 1/i)*C_point(lf(i-1)) - (2 + 1/i)/(1 + eta);
            end

            for l = 0:L
