            end
        end

        dEdS_eV_nm = (1e-7) * dEdS_eV_sm;


        % E_stop = 5;
        E_stop = min(E);
        nE_point = 500; %!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
        E_point = linspace(E0_eV, E_stop, nE_point);


