        E_dense_point_eV = 100;
        % t_by_dense_point = 1 - E_dense_point_eV/E0_eV;
        if E_dense_point_eV > E_stop
            mesh_density = nE_point/(E0_eV - E_stop);
            k_density = 20;
            high_mesh_density = k_density*mesh_density;
            nE_add = round( (E_dense_point_eV - E_stop)*high_mesh_density );
            E_point_add = linspace(E_dense_point_eV, E_stop, nE_add);

            idx_E_dense_point = 0;
            for i = 1:nE_point
                if E_point(i) <= E_dense_point_eV
                    idx_E_dense_point = i;
                    break;
                end
