            dE = E_point(i-1) - E_point(i);
            R_point(i-1) = R_point(i) + 0.5 * ( dSdE_point(i) + dSdE_point(i-1) ) * dE;
        end
        R0_nm = max(R_point);
        r_point = R_point/R0_nm;


        deds_point = dEdS_point*(R0_nm/E0_eV);
        e_point = E_point/E0_eV;
        t_point = 1 - e_point;

        EE_point = elastic_data(:,1)';
        n_EE = length(EE_point);
        theta_point = theta_grad * pi/180;
        n_theta_point = length(theta_point);
        dSigmadOmega_sm2_str  = elastic_data(:,2:end-1);

        dSigmadOmega_nm2_str = dSigmadOmega_sm2_str * 1e+14;
        % Sigma_tot_nm2 = Sigma_tot_sm2 * 1e+14;

        Nc = density*N_av/Av;
        Nc_nm3 = Nc * 1e-27;
        w_nm_str = Nc_nm3 * dSigmadOmega_nm2_str;


        inv_l_tr_point_nm = zeros(1,n_EE);
        for i = 1:n_EE
            w_nm_str_point = w_nm_str(i,:);
            integr_expr = 2*pi*w_nm_str_point.*(1-cos(theta_point)).*sin(theta_point);
            for j = 1:n_theta_point-1
                dtheta_point = theta_point(j+1) - theta_point(j);
                inv_l_tr_point_nm(i) = inv_l_tr_point_nm(i) + 0.5 * (integr_expr(j) + integr_expr(j+1))*dtheta_point;
            end
        end
        l_tr_point_nm = 1./inv_l_tr_point_nm;
        l_tr_point = l_tr_point_nm/R0_nm;

        temp_var = l_tr_point;

        l_tr_point = interp1(EE_point, temp_var, E_point, 'cubic');

