            R0i_nm = [878.8 587.93 71.16]; % nm
            E0i_eV = 1e+3 * [7.9 6.2 1.6];
        end


        E_stop = 50;
        nE_point = 500; %!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
        E_point = linspace(E0_eV, E_stop, nE_point);
        e_point = E_point/E0_eV;
        t_point = 1 - e_point;


        for j = 1:nE_point
            ii = 0;
            for i = 1:length(E0i_eV)-1
                if (E0i_eV(i)>=E_point(j))&&(E_point(j)>E0i_eV(i+1))
                    ii = i;
                end
            end
            if ii>0
                i = ii;
            else
                i = length(E0i_eV);
            end

            dEdS_point(j) = E0i_eV(i)/( alfai(i)* R0i_nm(i)) * (E_point(j)/E0i_eV(i))^(1-alfai(i));
        end


        R_point = zeros(size(E_point));
        dSdE_point = 1./dEdS_point;
        for i = nE_point:-1:2
            dE = E_point(i-1) - E_point(i);
            R_point(i-1) = R_point(i) + 0.5 * ( dSdE_point(i) + dSdE_point(i-1) ) * dE;
        end
        R0_nm = max(R_point);
        r_point = R_point/R0_nm;



        l_tr0i_nm = R0i_nm./d1i;
        L_tr_point = zeros(1,nE_point);
        for j = 1:nE_point
            ii = 0;
            for i = 1:length(E0i_eV)-1
                if (E0i_eV(i)>=E_point(j))&&(E_point(j)>E0i_eV(i+1))
                    ii = i;
                end
            end
            if ii>0
                i = ii;
            else
                i = length(E0i_eV);
            end
            L_tr_point(j) = l_tr0i_nm(i) * (E_point(j)/E0i_eV(i))^alfai(i);
        end




        l_tr_point = L_tr_point / R0_nm;
        deds_point = dEdS_point *(R0_nm/E0_eV);


    end


    % if isequal(data_type,'P') %% calculate by aproximation data
